import tkinter


def rgb_to_hex(rgb):
    """ Convert RGB tuples to hex appropriate for use as a color
        For example: (0, 255, 127) would become: #00ff7f"""
    hex_c = (f'#{rgb[0]:02x}{rgb[1]:02x}{rgb[2]:02x}')
    return hex_c

def draw_pict(w, h, pict):
    """ Takes a width, height, and a list of RGB tuples and draws
        as a picture in a tkinter window.
        This function is slow due to the number of rectangles the
        Canvas keeps references to"""
    window = tkinter.Tk()
    canvas = tkinter.Canvas(window, width=w, height=h)
    
    for x in range(w):
        for y in range(h):
            try:
                color = rgb_to_hex(pict[y * w + x])
            except (IndexError):
                print("Index out of bounds when drawing picture")
                print("Check the size of your list and make sure width and height are set correctly")
                print("x=", x, "y=", y, "w=", w, "h=", h)
            canvas.create_rectangle(x, y, x+1, y+1, fill=color, outline=color)
        canvas.update()
        canvas.pack()

